import { Container, Nav, NavDropdown, Navbar, NavbarBrand, NavItem } from "react-bootstrap";
import NavbarCollapse from "react-bootstrap/esm/NavbarCollapse";
import { ReactComponent as Logo } from "../img/logo.svg";
// import "../img/logo.svg";
import "../Styles.css";

function Header() {
  return (
    <Navbar className="menu-area menu-sticky">
        <Container>
            <NavbarCollapse>
            <Nav>
                <NavbarBrand>
                    Simex
                </NavbarBrand>
            </Nav>
            <Nav className="m-auto">
                <Nav.Link href="#index">About us</Nav.Link>
                <Nav.Link href="#index">Products</Nav.Link>
                <NavDropdown>
                    <NavItem href="#home">Test</NavItem>
                </NavDropdown>
                <Nav.Link href="#index">Resources</Nav.Link>
                <Nav.Link href="#index">Login</Nav.Link>
                <Nav.Link href="#index">Register</Nav.Link>
            </Nav>
            </NavbarCollapse>
        </Container>
    </Navbar>
  );
}

export default Header
